import React from 'react';
import './style.css';
import Search from './Search'

class Navbar extends React.Component {
  render() {
    return (
      <div className="navbar">
        <span className="">{this.props.name}</span>
        <Search/>
      </div>
    );
  }
}

export default Navbar;
